import React, { useState } from "react";
 const App=()=>{
    let newTime=new Date().toLocaleTimeString();
    const[time,setTime]=useState(newTime);
    const UpdateTime=()=>{
        newTime;
        setTime(newTime);
    }

    return(
        <>
        <div className="conatiner">
        <h1>{time}</h1>
        <button onClick={UpdateTime}>Get Time</button></div></>
    )
 }
export default App;
